using AEAssist;
using System.Numerics;
using AEAssist.CombatRoutine.Trigger;
using AEAssist.CombatRoutine.Trigger.Node;
using AEAssist.Helper;
using AEAssist.Extension;
using AEAssist.CombatRoutine.Module;
using AEAssist.CombatRoutine;


public class m2s点名黑盾 : ITriggerScript
{
    // 使用事件(True)，则脚本逻辑由Check方法控制。Check返回True代表此节点执行完毕
    public bool Check(ScriptEnv scriptEnv, ITriggerCondParams condParams)
    {
        //var spell = 7393u.GetSpell();

        if (condParams is not TargetIconEffectCondParams targetIcon)
        {
            return false;
        }

        if (targetIcon.Args0 == -237 || targetIcon.Args0 == -25)
        {
            var iconMember = PartyHelper.CastableAlliesWithin30.LastOrDefault(agent => agent == targetIcon.Target);


            if (iconMember == null)
            {
                LogHelper.Print("No suitable icon member found");
                return false;
            }

            if (iconMember != null && iconMember.IsDps())
            {
                LogHelper.Print($"目标是: ({iconMember.Name})");

                if (AI.Instance.BattleData.NextSlot != null)
                {
                    AI.Instance.BattleData.NextSlot.Add(new Spell(7393u, iconMember));
                    LogHelper.Print("插入黑盾");



                }
                else
                {
                    AI.Instance.BattleData.NextSlot = new Slot().Add(new Spell(7393u, iconMember));
                    LogHelper.Print("添加黑盾");

                }
                return true;
            }


        }



        return false;
    }
}
